import axios from 'axios';

export const API_BASE_URL = 'https://dd43-219-255-207-40.ngrok-free.app';

const api = axios.create({
  baseURL: API_BASE_URL,
  headers: {
    'Content-Type': 'application/json'
  }
});

export default api;
